GameData["squad_ui_ext"]["ui_info"]["help_text_id"] = [[$97071]] -- 
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[Unparalleled in ability with any other magician of the inquisition, the xanthite inquisitor is a truly fearsome opponent.]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[With his knowledge, a vast amount of spells can easily wipe out entire armies and bases]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[His powers also allow him to temporarily abandon his material body to possess a daemon]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[His rapid spell casting also provides very adaptable ranged defense]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[He is often accompanied by part of his kabal, which has the task of providing psychic support, allowing him to cast even more dreadful incantations]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[Such tremendous powers provoke fear in all those unfortunates who gaze upon them, bringing anyone on the brink of despair]]
GameData["squad_ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[]]
GameData["squad_ui_ext"]["ui_info"]["icon_name"] = [[inquisition_icons/inquisitor_lord_icon]]
